import React from 'react'

export default function Select(props) {
  const { setPageSize, options = [] } = props;
  return (
    <select
      onChange={e => setPageSize(e.target.value)}
    >
      {options.map(ele => <option value={ele}>{ele}</option>)}
    </select>
  )
}
